export const processEmployeeData = () => {
  const { resultData } = locationData;
  let result = [];
  let data = resultData.data;
  for (let key in data) {
    data[key].forEach(item => {
      if (item.x != 0 && item.y != 0) {
        result.push({ x: item.x, y: item.y });
      }
    });
  }

  return result;
};

